  LoadNikah() {
    this.pernikahanService.ShowNikah().subscribe(
      data => {
        this.nikahs = data;
        console.log(this.nikahs);
      },
      err => {
        console.log(err);
      }
    );
  }

  buildTableBody(data, columns, tanggal) {
    var body = [];

    body.push(columns);
    // body.push(data);

    data.forEach(function(row) {
      if (moment(row[0]).isBetween( moment(tanggal).startOf('month').format("YYYY-MM-DD"), moment(tanggal).endOf('month').format("YYYY-MM-DD") )) {
          row[0] = moment(row[0]).format("DD-MM-YYYY");
          body.push(row);
      }
    });
    // if() {
    //   body.push([
    //     {
    //       text: 'Tidak Ada Data!',
    //       colspan: 5,
    //       alignment: 'center'
    //     }
    //   ]);
    // }
    return body;
  }

  table(data, columns, tanggal) {
    return {
      table: {
        headerRows: 1,
        body: this.buildTableBody(data, columns, tanggal)
      }
    };
  }

  printNikah() {
    moment.locale("id");
    var nikahs = this.nikahs.map(function(nikah) {
      return [moment(nikah.tanggal).format("YYYY-MM-DD"), nikah.village.name, nikah.catinpria.nama, nikah.catinwanita.nama, nikah.penghulu.nama];
    });
    var dd = {
      styles: {
        header: {
          fontSize: 20,
          bold: true
        },
        subheader: {
          fontSize: 14,
        }
      },
      pageSize: 'A4',
      pageMargins: [40,130,40,20],
      header: {
        margin: 40,
        columns: [
          {
            image: 'data:image/png;base64,',
            width: 60
          },
          {
            margin: [10, 0, 0, 0],
            stack : [
              {
                text: 'KUA Kecamatan Mauk',
                style: 'header'
              },
              {
                text: 'Jl. Ir. Sutami No. 66\nMauk - Kabupaten Tangerang',
                style: 'subheader'
              }
            ],
          },
          {
            text: 'tanggal cetak :'+moment().format("LLLL"),
            alignment: 'right'
          }
        ]
      },
      content: [
        {
          text: 'Laporan Daftar Pernikahan',
          style: 'header'
        },
        {
          text: 'Bulan '+moment(this.tanggalPrint).format("MMMM YYYY"),
          style: 'subheader'
        },
        this.table(
          nikahs,
          ['Tanggal', 'Desa', 'Calon Pengantin Pria', 'Calon Pengantin Wanita', 'Penghulu'],
          this.tanggalPrint
        ),
        {
          alignment: 'center',
          columns: [
            {
              text: 'Menyetujui,\n\n\n\n\n\n\n\n'
            },
            {
              text: 'Mengetahui'
            }
          ]
        },
        {
          alignment: 'center',
          columns: [
            {
              text: 'H. AJAT SUDRAJAT, S.Pd.I', bold: 'true'
            },
            {
              text: 'A. KHATIBI R S, S.Pd.I., MM', bold: 'true'
            }
          ]
        },
        {
          alignment: 'center',
          columns: [
            {
              text: 'Kepala KUA'
            },
            {
              text: 'Kepala Tata Usaha'
            }
          ]
        },
      ]
    }
    pdfMake.createPdf(dd).getBuffer((buffer) => {
      var utf8 = new Uint8Array(buffer); // Convert to UTF-8...
      let binaryArray = utf8.buffer; // Convert to Binary...

      let fileName = "file.pdf";
      let saveDir = cordova.file.externalApplicationStorageDirectory;

      this.file.createFile(saveDir, fileName, true).then((fileEntry) => {
        fileEntry.createWriter((fileWriter) => {
          fileWriter.onwriteend = () => {
            let toast = this.toastCtrl.create({
              message: 'PDF Sukses Dibuat',
              duration: 2000,
              position: 'middle'
            });
            toast.onDidDismiss(() => {
              cordova.plugins.fileOpener2.open(
                saveDir+fileName,
                'application/pdf');
              });
              toast.present();
            };
            fileWriter.onerror = (e) => {
              console.log('file writer - error event fired: ' + e.toString());
            };
            fileWriter.write(binaryArray);
          });
        });
      });
    }

  ionViewDidLoad() {
    console.log('ionViewDidLoad PrintModalPage');
    this.LoadNikah();
  }

  showAlert() {
    let alert = this.alertCtrl.create({
      title: 'Data Kosong',
      subTitle: 'Bulan yang anda pilih tidak ada pernikahan',
      buttons: ['OK']
    });
    alert.present();
  }

  dismiss() {
    this.viewCtrl.dismiss();
  }
